(113, 1, '2017-02-17 11:29:36', '2017-02-17 11:29:36', '.icon-box{\n    border-radius: 2px;\n    cursor: pointer;\n    font-size: 16px;\n    margin-bottom: 8px;\n    padding: 8px;\n    background:#ccc;\n}\n.icon-box:hover{\n    background: #db2723 none repeat scroll 0 0;\n    color:#fff;\n}\n.icon-box > a{\n   color:#555;\n}\n.icon-box:hover > a {  color:#fff; }\n.icon-box i.fa {\n   padding-right: 10px;\n}\n.proejct-btn{\n text-align: center;\n}\n.proejct-btn a{\n    display: inline-block;\n    padding: 11px 25px;\n    margin-bottom: 0;\n    font-size: 16px;\n    line-height: 20px;\n    text-align: center;\n    vertical-align: middle;\n    cursor: pointer;\n    font-family: \'Roboto\';\n    transition: all 0.4s ease 0s;\n    border: 0px;\n    color: #fff !important;\n    background-color: #db2723;\n}\n.spoontalk-sociamedia-icons-widget .alignment {\n    margin:0;\n}\n', 'rambo-customizer-lite', '', 'publish', 'closed', 'closed', '', 'rambo-customizer-lite', '', '', '2017-02-17 11:29:36', '2017-02-17 11:29:36', '', 0, 'http://webriti.com/demo/wp/lite/rambo/index.php/2017/02/17/rambo-customizer-lite/', 0, 'custom_css', '', 0),
