(8, 1, '2015-12-17 07:17:58', '2015-12-17 07:17:58', '<div class=\"span6\"> \r\n					<img width=\"4928\" height=\"3264\" src=\"http://webriti.com/demo/wp/rambo/wp-content/uploads/2013/12/startup-593354.jpg\" class=\"about_img wp-post-image\" alt=\"startup-593354\">					\r\n				</div>\r\n							\r\n			<div class=\"span6\">\r\n								<div class=\"head_title\">\r\n					<h3>Who we are</h3>				</div>\r\n				<p></p><p>Quisque laoreet quam semper, consectetur velit in, congue odio. Quisque eget interdum mi. Vestibulum at lacinia enim. Vivamus sit amet erat pellentesque, aliquet massa id, mattis dolor. Mauris eu nibh malesuada, elementum leo non, accumsan velit. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.</p>\r\n<p>Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.</p>\r\n<p></p>\r\n</div>\r\n		', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2015-12-17 07:17:58', '2015-12-17 07:17:58', '', 0, 'http://webriti.com/demo/wp/lite/rambo/?page_id=8', 0, 'page', '', 0),
(10, 1, '2015-12-17 07:18:15', '2015-12-17 07:18:15', '<div class=\"span12\">[gallery size=\"medium\" ids=\"49,50,51,52,53,54,55,56,65\"]\r\n\r\nNote: This portfolio page is created by using WordPress default core gallery shortcode. This is to demonstrate how the theme present the shortcode output. If you want more fancy portfolio with filter tags and control over columns layout, than check Pro Version of <a href=\"http://webriti.com/rambo\" target=\"_blank\">Rambo Theme</a>\r\n</div>', 'Portfolio', '', 'publish', 'closed', 'closed', '', 'portfolio-2', '', '', '2015-12-17 07:18:15', '2015-12-17 07:18:15', '', 0, 'http://webriti.com/demo/wp/lite/rambo/?page_id=10', 0, 'page', '', 0),
